DROP DATABASE bus_ware;

CREATE DATABASE bus_ware;

\c bus_ware

CREATE TABLE bus_info(
	bus_id varchar(20) PRIMARY KEY NOT NULL,
	name varchar(20),		
	from_place varchar(20),
	to_place varchar(20),
	depart time NOT NULL,
	arrive time NOT NULL,
	a_c_fact integer,
	bus_type varchar(20)
);

CREATE TABLE route_table(
	bus_id varchar(20)  NOT NULL,
	from_add varchar(20),
	to_add varchar(20),
	depart time NOT NULL,
	arrive time NOT NULL,
	fare integer,	
	FOREIGN KEY (bus_id) REFERENCES bus_info(bus_id)
);

/*CREATE INDEX idx_places on route_table USING GIN (places_visit);*/

CREATE TABLE seats(
	date_int integer NOT NULL,
	bus_id varchar(20) NOT NULL,
	no_seats integer NOT NULL,
	seat_type varchar(20),
	status varchar(20),  
	FOREIGN KEY (bus_id) REFERENCES bus_info (bus_id)
);




























